import{_ as a,v as e,b as t,R as o}from"./chunks/framework.a49639fc.js";import{_ as i,a as n}from"./chunks/uwax-private-key-btn.c1dee75a.js";const f=JSON.parse('{"title":"Import your account’s private key","description":"","frontmatter":{"title":"Import your account’s private key","deploy":[],"order":10,"outline":[0,4]},"headers":[],"relativePath":"guides/uwax/import-private_key.md","filePath":"guides/uwax/import-private_key.md","lastUpdated":1692629754000}'),r={name:"guides/uwax/import-private_key.md"},s=o('<h1 id="import-your-account-s-private-key" tabindex="-1">Import your account’s private key <a class="header-anchor" href="#import-your-account-s-private-key" aria-label="Permalink to &quot;Import your account’s private key&quot;">​</a></h1><p>The Ultra Wallet Extension supports two kinds of accounts EBA and Non-EBA, to understand how a private key can be imported into the wallet, we have to explain first the differences between both account types.</p><h2 id="eba-easy-blockchain-account" tabindex="-1">EBA (Easy Blockchain Account) <a class="header-anchor" href="#eba-easy-blockchain-account" aria-label="Permalink to &quot;EBA (Easy Blockchain Account)&quot;">​</a></h2><p>One of the most critical missions of Ultra is to democratize the blockchain, bringing all its advantages to the mass market. To do so, it was required to simplify drastically how the blockchain is managed, making it almost transparent for the user.</p><p>The EBA is a flow where the users store their own private keys in their devices and Ultra only provides a way to recover a blockchain account or sync a private key with a blockchain account.</p><p>To get an Easy Blockchain Account you only have to create an Ultra account using the Ultra Wallet Extension or the Ultra Desktop client.</p><p><img src="'+i+'" alt=""></p><h2 id="non-eba-self-managed-blockchain-account" tabindex="-1">Non-EBA (Self-managed blockchain account) <a class="header-anchor" href="#non-eba-self-managed-blockchain-account" aria-label="Permalink to &quot;Non-EBA (Self-managed blockchain account)&quot;">​</a></h2><p>A non-EBA account is a typical blockchain account controlled by private keys you must secure yourself. It is mostly used for developing purposes. To know more about it read this <a href="/experimental/guides/Docker/nodeos.html">documentation page</a>.</p><p>To import your blockchain account’s private key use this option in your wallet and follow the process, the wallet will ask you for a strong password to encrypt it, this password is not stored in the wallet so you have to save it securely, otherwise, you won’t be able to unlock your wallet again.</p><p>Once the private key is imported and encrypted, you will be able to select and activate the associated accounts.</p><p><img src="'+n+'" alt=""></p>',12),c=[s];function l(p,u,h,d,y,m){return e(),t("div",null,c)}const v=a(r,[["render",l]]);export{f as __pageData,v as default};
